import React, { useState, useEffect } from 'react';
import PostFeed from '../components/Feed/PostFeed';
import CreatePost from '../components/Feed/CreatePost';
import Navbar from '../components/Navbar';
import axios from 'axios';

const Home = () => {
    const [posts, setPosts] = useState([]);
    const [loading, setLoading] = useState(true);

    const fetchPosts = async () => {
        setLoading(true);
        try {
            const response = await axios.get(`${process.env.REACT_APP_API_URL}/posts`);
            setPosts(response.data);
        } catch (error) {
            console.error('Error fetching posts:', error);
        } finally {
            setLoading(false);
        }
    };

    useEffect(() => {
        fetchPosts();
    }, []);

    const handlePostCreated = () => {
        fetchPosts();
    };

    return (
        <div className="bg-gray-100 min-h-screen">
          /  <Navbar />
            <div className="container mx-auto flex flex-col md:flex-row gap-6 px-4 py-8">
                <aside className="hidden md:block md:w-1/4">
                    <div className="bg-white rounded-lg shadow-md p-6 mb-6">
                        <div className="flex flex-col items-center">
                            <div className="w-20 h-20 bg-blue-200 rounded-full mb-4"></div>
                            <h2 className="font-semibold text-lg text-gray-800">Your Name</h2>
                            <p className="text-gray-500 text-sm">Your Bio</p>
                        </div>
                    </div>
                    <div className="bg-white rounded-lg shadow-md p-6">
                        <h3 className="font-semibold text-gray-800 mb-4">Suggestions</h3>
                        <ul className="space-y-2">
                            <li className="text-sm text-gray-600">Connect with others!</li>
                        </ul>
                    </div>
                </aside>

                <main className="w-full md:w-2/4">
                    <CreatePost onPostCreated={handlePostCreated} />
                    <div className="bg-white rounded-lg shadow-md p-6">
                        <h1 className="text-2xl font-bold mb-6 text-blue-700">Home Feed</h1>
                        {loading ? (
                            <p>Loading posts...</p>
                        ) : posts.length > 0 ? (
                            <PostFeed posts={posts} />
                        ) : (
                            <p>No posts available yet.</p>
                        )}
                    </div>
                </main>

                <aside className="hidden md:block md:w-1/4">
                    <div className="bg-white rounded-lg shadow-md p-6">
                        <h3 className="font-semibold text-gray-800 mb-4">Trending</h3>
                        <ul className="space-y-2">
                            <li className="text-sm text-gray-600">#React</li>
                            <li className="text-sm text-gray-600">#NodeJS</li>
                            <li className="text-sm text-gray-600">#MongoDB</li>
                        </ul>
                    </div>
                </aside>
            </div>
        </div>
    );
};

export default Home;
